import React, {Component} from 'react';
import s from './Post.module.css';

const Post = (props) => {
    return (
        <div className={s.post}>
            <img src='https://pbs.twimg.com/profile_images/908447270298828800/odnirBg8_400x400.jpg' alt=''/>
            {props.message}
            <div>
                <span>Like</span> {props.likesCount}
            </div>
        </div>


    );
}

export default Post
